#
# Procedure "split_page"
#

DROP PROCEDURE IF EXISTS `split_page`;
CREATE PROCEDURE `split_page`(IN `_fields` varchar(2000),IN `_tables` text,IN `_where` varchar(2000),IN `_orderby` varchar(2000),IN `_pageindex` int,IN `_pagesize` int,IN `_sumfields` varchar(2000),OUT `_totalcount` int,OUT `_pagecount` int)
BEGIN
	set @startRow = _pageSize*(_pageIndex -1);
   set @pageSize = _pageSize;  set @rowindex = 0;
     set @strsql = CONCAT('select sql_calc_found_rows @rowindex:=@rowindex+1 as rownumber,',_fields,' from ',_tables,case ifnull(_where,'') when '' then '' else concat(' where ',_where) end,' order by ',_orderby,' limit ',@startRow,',',@pageSize);
     prepare strsql from @strsql;
     execute strsql;
   deallocate prepare strsql;
   set _totalcount = found_rows(); 

   if (_totalcount <= _pageSize) then

                    set _pagecount = 1;
                    else if (_totalcount % _pageSize > 0) then
                    set _pagecount = _totalcount / _pageSize + 1;
                    else
                     set _pagecount = _totalcount / _pageSize;
            end if;
        end if;

if(ifnull(_sumfields,'') <> '') then set @sumsql = contact('select ',_sumfields,' from ',_tables,case ifnull(_where,'') when '' then '' else concat(' where ',_where) end); prepare sumsql from @sumsql; execute sumsql; deallocate prepare sumsql; end if;

END;
